create table monsters_drops
(
    Id                     int auto_increment
        primary key,
    MonsterOwnerId         int             null,
    ItemId                 smallint        null,
    DropLimit              int default 0   null,
    DropRateForGrade1      float(16, 2)    null,
    DropRateForGrade2      float(16, 2)    null,
    DropRateForGrade3      float(16, 2)    null,
    DropRateForGrade4      float(16, 2)    null,
    DropRateForGrade5      float(16, 2)    null,
    RollsCounter           int default 1   null,
    ProspectingLock        int default 100 null,
    `Condition`            mediumtext      null,
    DropGroup              int             null,
    TaxCollectorCannotLoot tinyint         null
)
    engine = MyISAM
    charset = utf8;

